const Contact = () => {
    return (
      <div className="container mx-auto p-4">
        <h1 className="text-xl font-bold mb-4">تواصل معنا</h1>
        <p>يمكنك التواصل معنا عبر البريد الإلكتروني: support@mystore.com</p>
        <p>أو عبر الهاتف: 123-456-7890</p>
      </div>
    );
  };
  
  export default Contact;
